import React, { useEffect } from "react";

export const SignOut = ({ handleSignOut }) => {
    useEffect(() => {
        handleSignOut(); // Call the handleSignOut function when the SignOut component mounts
    }, [handleSignOut]);

    return (
        <div>
            <h1>Signed out!</h1>
        </div>
    );
};

export default SignOut;
